import { InitialStateCount, CounterTypes, CounterActionTypes } from "../Types";

const InitialState: InitialStateCount = {
  count: 1,
};

const reducerCounter = (state = InitialState, action: CounterActionTypes) => {
  switch (action.type) {
    case CounterTypes.INCREMENT:
      return {
        count: state.count + 1,
      };

    case CounterTypes.DECREMENT:
      return {
        count: state.count - 1,
      };

    default:
      return state;
  }
};

export default reducerCounter;
